    for ai in missiles:
        s = sum(ai)
        sa.append([s, ai])
    f = True
    while f:
        f = False
        sa.sort()
        (ls, la) = sa[-1]
        if ls == 0:
            break
        ls2 = sa[-2][0]
        if ls - la[-1] >= ls2 - d:
            sa[-1] = [ls - la[-0], la[:-1]]
            f = True
            continue
        for i in range(n - 2, -1, -1):
            (ts, ta) = sa[i]
            if ts == 0:
                break
            if ts - ta[-1] >= ls - d:
                sa[i] = [ts - ta[-1], ta[:-1]]
                f = True
    if sa[-1][0] == 0:
        return 'Yes'
    else:
        return 'No'

